import { useSelector } from "react-redux";
import { useUploadUserMutation } from '../store';

const UploadUser = ()=>
{
    const user = useSelector(state => user.userData);
    const [uploadUser, updateUserResults] = useUploadUserMutation();
    uploadUser(user);
    console.log(user);
}

export {UploadUser};
